import React from 'react';
import Counter from './Counter';

class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {count: 0}
  }

  countUp() {
    this.setState({count: this.state.count + 1});
  }
  countDown() {
    this.setState({count: this.state.count - 1});
  }


  render() {
    return(
      <Counter></Counter>

    );
  }
}

export default App;
